int DOMTest_Ns8_Handout_master (OSCTXT* pctxt, Ns8_Handout_master* pvalue, 
   xmlNodePtr pXmlNode, OSBOOL setChild)
{
   xmlAttrPtr pXmlAttr = pXmlNode->properties;

   /* Populate attributes */
   for ( ; 0 != pXmlAttr; pXmlAttr = pXmlAttr->next) {
      if (pXmlAttr->type == XML_ATTRIBUTE_NODE) {
         if (rtxUTF8StrEqual (pXmlAttr->name, OSUTF8("style-name"))) {
            pvalue->m.style_namePresent = 1;
            pvalue->style_name = rtxMemAllocType (pctxt, Ns3_Style_name);

            if (pvalue->style_name == NULL)
               return LOG_RTERR (pctxt, RTERR_NOMEM);

            asn1Init_Ns3_Style_name ((Ns3_Style_name*)pvalue->style_name);
            DOMTest_Ns3_Style_name (pctxt, (Ns3_Style_name*)pvalue->style_name, pXmlAttr, FALSE);
         }
         else if (rtxUTF8StrEqual (pXmlAttr->name, OSUTF8("presentation-page-layout-name"))) {
            pvalue->m.presentation_page_layout_namePresent = 1;
            pvalue->presentation_page_layout_name
                = rtxMemAllocType (pctxt, Ns10_Presentation_page_layout_name);

            if (pvalue->presentation_page_layout_name == NULL)
               return LOG_RTERR (pctxt, RTERR_NOMEM);

            asn1Init_Ns10_Presentation_page_layout_name ((Ns10_Presentation_page_layout_name*)pvalue->presentation_page_layout_name);
            DOMTest_Ns10_Presentation_page_layout_name (pctxt, (Ns10_Presentation_page_layout_name*)pvalue->presentation_page_layout_name, pXmlAttr, FALSE);
         }
         else if (rtxUTF8StrEqual (pXmlAttr->name, OSUTF8("use-date-time-name"))) {
            pvalue->m.use_date_time_namePresent = 1;
            if (0 != ((xmlNodePtr)pXmlAttr)->children) {
               pvalue->use_date_time_name = ((xmlNodePtr)pXmlAttr)->children->content;
            }
            else {
               pvalue->use_date_time_name = (const OSUTF8CHAR*)"";
            }
         }
         else if (rtxUTF8StrEqual (pXmlAttr->name, OSUTF8("use-footer-name"))) {
            pvalue->m.use_footer_namePresent = 1;
            if (0 != ((xmlNodePtr)pXmlAttr)->children) {
               pvalue->use_footer_name = ((xmlNodePtr)pXmlAttr)->children->content;
            }
            else {
               pvalue->use_footer_name = (const OSUTF8CHAR*)"";
            }
         }
         else if (rtxUTF8StrEqual (pXmlAttr->name, OSUTF8("use-header-name"))) {
            pvalue->m.use_header_namePresent = 1;
            if (0 != ((xmlNodePtr)pXmlAttr)->children) {
               pvalue->use_header_name = ((xmlNodePtr)pXmlAttr)->children->content;
            }
            else {
               pvalue->use_header_name = (const OSUTF8CHAR*)"";
            }
         }
         else if (rtxUTF8StrEqual (pXmlAttr->name, OSUTF8("page-layout-name"))) {
            DOMTest_Ns8_Page_layout_name (pctxt, &pvalue->page_layout_name, pXmlAttr, FALSE);
         }
      }
   }
   /* Populate elements */
   if (setChild)
      pXmlNode = pXmlNode->children;

   for ( ; 0 != pXmlNode; pXmlNode = pXmlNode->next) {
      if (pXmlNode->type == XML_ELEMENT_NODE) {
         if (rtxUTF8StrEqual (pXmlNode->name, OSUTF8("rect")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("line")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("polyline")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("polygon")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("regular-polygon")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("path")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("circle")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("ellipse")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("g")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("page-thumbnail")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("frame")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("measure")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("caption")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("connector")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("control")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("scene")) ||
         rtxUTF8StrEqual (pXmlNode->name, OSUTF8("custom-shape"))) {
            { Ns8_Handout_master_element* pdata2;
            pdata2 = rtxMemAllocType (pctxt, Ns8_Handout_master_element);

            if (pdata2 == NULL)
               return LOG_RTERR (pctxt, RTERR_NOMEM);

            asn1Init_Ns8_Handout_master_element (pdata2);
            DOMTest_Ns8_Handout_master_element (pctxt, pdata2, pXmlNode, FALSE);
            if (0 != pdata2)
               rtxDListAppend (pctxt, &pvalue->choice_list, (void*)pdata2);
            }
         }
      }
   }

   return 0;
}

